import React, { useState } from 'react'
import CusNavbar from '../components/Navbar'
import SearchForm from '../components/SearchForm'
import {Button, Alert} from 'react-bootstrap';
import { AlertProvider } from '../context/AlertContext';
import Alerts from '../components/Alert';
import LoginModal from '../components/LoginModal';

const LandingView = () => {
  // const { alertMessage, alertVariant } = useAlert();
  // const [alertMessage, setAlertMessage] = useState<string | null>(null);
  //   const [alertVariant, setAlertVariant] = useState<string | undefined>(undefined);
   
  return (
    <>
    <CusNavbar />
    <Alerts alertMessage={LoginModal.alertMessage} alertVariant={LoginModal.alertVariant} setAlertMessage={LoginModal.setAlertMessage}/>
    <SearchForm />
    </>
  )
}

export default LandingView

function useAlert(): { alertMessage: any; alertVariant: any; } {
  throw new Error('Function not implemented.');
}
